const styles: any = (theme: any) => ({
    headerLabel: {
        paddingLeft: '35px'
    },
    paperRoot: {
        width: '90%',
        textAlign: 'center',
        paddingLeft: "100px"
    },
    gridRoot: {
        marginLeft: '300px'
    },
    card: {
        minWidth: 275,
        maxWidth: 500
    },
    bullet: {
        display: 'inline-block',
        margin: '0 2px',
        transform: 'scale(0.8)',
    },
    title: {
        fontSize: 14,
    },
    pos: {
        marginBottom: 12,
    }
})

export default styles;
